import React, { useEffect, useState } from "react";
import "./Profile.css";
import VideoCard from "./VideoCard";
import PostDetail from "./PostDetail";

export default function Profie() {
  var picLink = "https://cdn-icons-png.flaticon.com/128/3177/3177440.png";
  const [pic, setPic] = useState([]);
  const [show, setShow] = useState(false);
  const [posts, setPosts] = useState([]);
  const [user, setUser] = useState("");
  const [videos, setVideos] = useState([]);
  const [activeTab, setActiveTab] = useState('posts');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        const token = localStorage.getItem("jwt");
        if (!token) {
          console.log("No JWT token found");
          return;
        }

        // Get user ID from token
        const storedUserData = JSON.parse(localStorage.getItem("user"));
        const userId = storedUserData._id;
        console.log("Fetching data for user:", userId);

        // Fetch user data and posts
        const userRes = await fetch(`http://localhost:4000/user/${userId}`, {
          headers: {
            Authorization: "Bearer " + token,
          },
        });
        const fetchedUserData = await userRes.json();
        console.log("User data response:", fetchedUserData);
        setUser(fetchedUserData.user);
        setPosts(fetchedUserData.post);

        // Fetch user's videos
        console.log("Fetching videos for user:", userId);
        const videosRes = await fetch(`http://localhost:4000/video/user/${userId}`, {
          headers: {
            Authorization: "Bearer " + token,
          },
        });
        console.log("Videos response status:", videosRes.status);
        const videosData = await videosRes.json();
        console.log("Raw videos data:", videosData);
        setVideos(videosData);
      } catch (err) {
        console.error("Error fetching user data:", err);
        setVideos([]);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const handleVideoUpdate = () => {
    // Refetch videos after update
    const fetchVideos = async () => {
      try {
        const token = localStorage.getItem("jwt");
        const userData = JSON.parse(localStorage.getItem("user"));
        const userId = userData._id;

        const videosRes = await fetch(`http://localhost:4000/video/user/${userId}`, {
          headers: {
            Authorization: "Bearer " + token,
          },
        });
        const videosData = await videosRes.json();
        setVideos(videosData);
      } catch (err) {
        console.error("Error refetching videos:", err);
      }
    };
    fetchVideos();
  };

  const toggleDetails = (post) => {
    setShow(!show);
    setPic(post);
  };

  if (loading) {
    return <div className="profile">Loading...</div>;
  }

  return (
    <div className="profile">
      {/* Profile frame */}
      <div className="profile-frame">
        {/* profile-pic */}
        <div className="profile-pic">
          <img src={user.Photo ? user.Photo : picLink} alt="" />
        </div>
        {/* profile-data */}
        <div className="pofile-data">
          <h1>{user.name}</h1>
          <div className="profile-info" style={{ display: "flex" }}>
            <p>{posts ? posts.length : 0} posts</p>
            <p>{videos ? videos.length : 0} videos</p>
            <p>{user.followers ? user.followers.length : 0} followers</p>
            <p>{user.following ? user.following.length : 0} following</p>
          </div>
        </div>
      </div>
      <hr
        style={{
          width: "90%",
          opacity: "0.8",
          margin: "25px auto",
        }}
      />

      {/* Tabs */}
      <div className="profile-tabs">
        <button
          className={`tab-button ${activeTab === 'posts' ? 'active' : ''}`}
          onClick={() => setActiveTab('posts')}
        >
          Posts
        </button>
        <button
          className={`tab-button ${activeTab === 'videos' ? 'active' : ''}`}
          onClick={() => setActiveTab('videos')}
        >
          Videos
        </button>
      </div>

      {/* Content based on active tab */}
      {activeTab === 'posts' ? (
        <div className="gallery">
          {posts && posts.map((pics) => (
            <img
              key={pics._id}
              src={pics.photo}
              className="item"
              alt=""
              onClick={() => toggleDetails(pics)}
            />
          ))}
        </div>
      ) : (
        <div className="videos-grid">
          {videos && videos.map((video) => (
            <VideoCard
              key={video._id}
              video={video}
              onVideoUpdate={handleVideoUpdate}
            />
          ))}
        </div>
      )}
      {show && <PostDetail item={pic} toggleDetails={toggleDetails} />}
    </div>
  );
}
